(11, 1959758001, 'Nov 24, 2016 06:58 PM', '\n    Greetings from Fulfillment by Amazon,\n    \n        \n            Thank you for bringing this attention. I hope that you are doing fine today.We understand your concern regarding your Inventory Storage limit, I carefully check on your account under FBA Shipments and I have verified that you are eligible for increasing storage limit. Hence, as per your request I have updated and increased your storage limit. To confirm please click on the link below:https://sellercentral.amazon.com/gp/fba/inbound-queue/index.html/ref=ag_xx_cont_fbashipqKeep in mind that any shipments you have created that are active contribute to the inventory levels. If you have created shipments that you don\'t intend to send right away, try canceling them.Please have your sales sell more than 8% of your inventory every week for 6 weeks in a row. The Inventory Health Report can help you identify inventory that doesn\'t sell quickly, so you can remove it and free up space for new inventory.Note: Decisions are made on a case-by-case basis, and are influenced by factors such as inventory turnover rates and the type of inventory you currently maintain.It can take up to twenty-four hours for your inventory level to be updated once you cancel a shipment or create a removal order.For more additional information please refer on the links below:Get help faster with these Seller Support tools https://sellercentral.amazon.com/gp/help/202098760?referral=A20BL8NRQY42S8_A2ZV8RL182JP4HLearn more about Inventory Storage Limits:https://sellercentral.amazon.com/gp/help/200685730?referral=A20BL8NRQY42S8_A2ZV8RL182JP4HGo the Inventory Health Report:https://sellercentral.amazon.com/gp/ssof/reports/search.html/?recordType=INVENTO...If there is still something that I missed to mention or I could still do to assist you with this issue, please let me know. I would love to always hear from you. Always remember that we\'re just an email away and always available for you. It gives me immense pleasure in playing an invisible role in the success of your business. From the bottom of my heart, wishing you sound health, wealth and success in all your future endeavors and sales with Amazon.Please let us know how we did.Were you satisfied with the support provided?  Click here for yes: https://sellercentral.amazon.com/hz/case-dashboard/hmd?p=A37M5J2ZAUF4EL&c=1959758001&k=hyClick here for no: https://sellercentral.amazon.com/hz/case-dashboard/hmd?p=A37M5J2ZAUF4EL&c=1959758001&k=hn  Thank you! To view your case details, or respond, please click http://sellercentral.amazon.com/gp/case-dashboard/view-case.html/ref=sc_cd_lobby_vc?caseID=1959758001Please note: this e-mail was sent from an address that cannot accept incoming e-mail. If you require additional support please contact us https://sellercentral.amazon.com/hz/contact-usYour Current Notifications----------------------------------------"SmartLife Bike Bicycle Crank Extractor Bottom Bracket Remover Spanner Repair Tools Kit Crank Puller" is on customer wish lists but has few active offers.Take advantage of this opportunity by offering this product to customers.Create an offer for this ASIN (B01FDLCJAO)https://catalog.amazon.com/abis/Display/ItemSelected?asin=B01FDLCJAO&iris_notification_id=d458ed9d246be11f0d6494365758f96c----------------------------------------Thank you for selling with Amazon,Elmar C.Amazon.com Seller Support=======================================MORE WAYS TO GET HELP:Visit our Seller Forums for help from other sellers: http://sellercentral.amazon.com/forumsBrowse all Seller Help topics: http://sellercentral.amazon.com/gp/helpTo contact us again about this issue, please use the Contact Us form in Seller Central using the following link:http://sellercentral.amazon.com/gp/contact-us/contact-amazon-form.html?caseID=1959758001Please note: this e-mail was sent from a notification-only address that cannot accept incoming e-mail. Please do not reply to this message.\n        \n       